import React from "react";

function PostedImageComponent() {
    const images = ['http://www.bhc.co.kr/upload/bhc/menu/ck20150130_470_v.jpg',
                'https://images.velog.io/images/carminchameleon/post/e62b5da0-a6f4-4d6e-845b-4db3053e19e7/image.png',
                'https://blog.kakaocdn.net/dn/criONw/btqGWTUql5w/G8HUksO7r4UMzAsZXi9LN1/img.png',
                'http://www.bhc.co.kr/upload/bhc/menu/ck20150130_470_v.jpg',
                'http://www.bhc.co.kr/upload/bhc/menu/ck20150130_470_v.jpg',
                ]

    const StyleDiv = {
        margin: 'auto',
        marginLeft: '10px',
        marginRight: '10px'
    }
    return(
        images.map((image)=>{return (
            <img style={{
                width: '150px',
                height: '150px',
                margin: 'auto',
                marginLeft: '10px',
                marginRight: '10px',
                border: '0.5px solid black',

            }} alt="chicken" src={image}></img>
        )})
    )
}

export default PostedImageComponent
